<?
	//Гатегории постов гео регионов
	$categories = array(
			'australia' => array( 'id'=> 6, 'title'=>'Australia', 'marker' => false), 
			'asia' => array( 'id'=> 7, 'title'=>'Asia', 'marker' => false), 
			'namerica' => array( 'id'=> 8, 'title'=>'North America', 'marker' => false), 
			'samerica' => array( 'id'=> 9, 'title'=>'South America', 'marker' => false), 
			'africa' => array( 'id'=> 10, 'title'=>'Africa', 'marker' => false), 
			'europe' => array( 'id'=> 11, 'title'=>'Europe', 'marker' => false)
			) ;
			
	
	//Получае по 3 поста из каждой категории
	foreach($categories as $region=>$cat){ ?>
    <?
		$args = array('category'=> $cat['id'],  'ignore_sticky_posts' => 1, 'numberposts' => 3	);
		$posts = get_posts($args);
		
		//Обрабатываем каждый пост, формируем html блоков
		if(is_array($posts) and count($posts) > 0 ){ ?>
			
            <div class="popup-wraper <?=$region?> marker_<?=$region?>" >
           
           <? /*
           	 <div class="title-block"><?=$cat['title']?></div>
             <div  class="close-block" onClick="popup_close_all();"></div>
			*/ 
			?>
            
			<?	$i = 1;
				foreach($posts as $post){ 
					if ($i > 2) break; // выходим из цикла если обработано 2 записи
					$img = get_field('anons_img', $post->ID);
					$subtitle = get_field('subtitle', $post->ID);
					//echo '<pre>'; print_r($img); echo '</pre>';
			?>
            
                	<a class="blog-post anim" href="<?=the_permalink($post);?>">
                        <span class="blog-img" style="background-image:url(<?=$img['sizes']['thumbnail']?>);"></span>
                        <span class="blog-country"><?=$subtitle;?></span>
                        <span class="blog-title"><?=$post->post_title;?></span>
                    </a>
                    
			<? 
				$categories[$region]['marker'] = true; //Помечаем необходимость аркера для данной категории
				$categories[$region]['link'] = get_category_link(); //Помечаем необходимость аркера для данной категории
				$i ++ ;
				} 
			?>
        	
			<? // Если постов больше 2, показываем ссылку на раздел блога
			if(count($posts) > 0 ){
				$categories[$region]['link'] = get_category_link($cat['id']); //Помечаем необходимость аркера для данной категории
     		}    
			 if(count($posts) > 2 ){ ?>
	        	<a href="<?=get_category_link($cat['id']);?>" class="read-more anim">Read more</a>
     		<? } ?>       
            
          	</div>
        <?
		}else{
		?>
		    <div class="popup-wraper <?=$region?> marker_<?=$region?>" >
            <p style=" display:block; text-align:center; color:#FFFFFF; padding:20px">Looking forward to coming here soon!<br>Meanwhile, check out my other adventures!</p>
            <a href="/category/blog/" class="read-more anim">Read more</a>


			</div>
		
		<?	
			
		}

	
	
	}
